ait naturel de vanille) noisettes (5.44%) stabilisant : E420ii, arôme naturel de vanille. Macaron vanille : Sucre glace, amandes brutes et en poudre, blancs d\'œufs, beurre, arôme naturel de vanille (2,59%).', 'https://static.openfoodfacts.org/images/products/376/010/552/0120/front_fr.4.400.jpg', '17.1', '5.9', '58', '57.9', '2.3', '7.4', '0.125', '0.0492125984251968', '', '0');

