INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3760106180804', 'Huile vierge de chanvre', 'Produite dans notre atelier en Bretagne ou issue d\'exploitations françaises en agro-biologie, notre huile de chanvre vous ravira par son goût incomparable proche de la noisette, mais aussi par ses vertus. Très riche et bien équilibrée en acides gras poly-insaturés (76% env.), elle contribue au bon fonctionnement du système car- dio-vasculaire grâce aux Oméga 3. L\'acide apha-linolénique (ALA) contri- bue au maintien d\'une cholestérolémie normale. L\'effet bénéfique est obtenu par la consommation journalière de 2g d\'ALA. Appréciez-la sur tous vos plats froids ou chauds, SANS JAMAIS LA CUIRE. Bon appétit Consommation recommandée : I à 2 cuillerée\' à café par jour. Conservation : 6 mois après ouverture, au frais et à l\'abri de la lumière.. Anaiyse nutritionnelle pour 100mi Voieurs énergétiques en 900KcaÌ./100r Protéines Giocides lipides dont : Acides gras saturés Acides mono-insaturés Acides polyhnsaturés Acide alphaiino!éique (oméga - Acide linoléique (oméga 6) Acide gamma-iinoÌéiquD Tout plein d\'infos tous nos produits sur www.lchanvre.com et d\'idées recettes', 'https://static.openfoodfacts.org/images/products/376/010/618/0804/front_fr.4.400.jpg', '82', '10.45', '0', '0', '0', '0', '0', '0', '', '0');

