INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3760108730120', 'Le kig ha farz', 'Plat traaltlonnel u \'l\'ilbtere le Léon le Kig ha Farz est composé d\'une potée faite de jarret, poitrine porc, saucisson à l\'ail fumé et de légumes : le KIG, et d\'une semoule de sarrasin cuite 3 heures dans un sac de lit au milieu de la potée, puis émiettée : le FARZ. Parmi les nombreuses recettes, celle-ci est celle de ma Mémé de Cléder. CONSEILS DE PRÉPARATION AU BAIN-MARIE (recommandé) Retirez les sachets de leur emballage carton, et plongez-les dans une casserole d\'eau frémissant pendant 15 minutes. Émiettez le farz. Vous pouvez agrémenter votre Kig Ha Farz d\'une sauce composée d\'un 1/2 oignon et d\'une 1/2 échalote con/ dans du beurre 1/2 sel. AU MICRO-ONDE Retirez les sachets de leur emballage carton Réchauffez 3 minutes à 750W, Émiettez le farz. Le Kig', 'https://static.openfoodfacts.org/images/products/376/010/873/0120/front_fr.4.400.jpg', '3.4', '1', '12', '0.5', '', '7.5', '0.5', '0.196850393700787', '', '1');

